import React from 'react';
import { View, Text, Button } from 'react-native';

function ToDoItem({ task, handleDelete }) {
    return (
        <View>
            <Text>{task}</Text>
            <Button title="Delete" onPress={handleDelete} />
        </View>
    );
}

export default ToDoItem;
